export const USER_DETAILS = "user_details";
export const setUserDetails = (data) => ({
    type: USER_DETAILS,
    data: data
})

export const PROJECT_DETAILS = "project_details";
export const setProjectDetails = (data) => ({
    type: PROJECT_DETAILS,
    data: data
})

export const TASK_DETAILS = "task_details";
export const getTaskData = (data) => ({
    type: TASK_DETAILS,
    data: data
})
